import home1 from '../img/home1.png';
import '../css/Start.css';

function Start() {
  return (
    <div className="all">
        <img className="bridge" src={home1}></img>
        <div className="menuBtn">
          <ul className="homeBtn">
          <button className="Bt1">여행지</button>
          <button className="Bt2">음식점</button>
          <button className="Bt3">숙박</button>
          <button className="Bt4">기타</button>
          </ul>
          
        </div> 
    </div>
  );
}

export default Start;
